sys_ux_client_script.script:
/**
 * @param {params} params
 * @param {api} params.api
 * @param {TransformApiHelpers} params.helpers
 */
function evaluateProperty({
    api,
    helpers
}) {
    if (api.data.subjects.result.risk.value === "green") {
        return 'primary-positive';
    } else if (api.data.subjects.result.risk.value === "red") {
        return 'primary-negative';
    } 
}
